{"translationLines":[{"lineNumber":217912,"originalJapaneseLine":"都市の中心地へと進めながら、","translatedEnglishLine":"Advancing toward the city center,"},{"lineNumber":217913,"originalJapaneseLine":"あなた達はスケールの中を歩く。","translatedEnglishLine":"you walk within the scale."},{"lineNumber":217914,"originalJapaneseLine":"「いーい？　ザンスちゃん。","translatedEnglishLine":"\"Alright? Zans-chan."},{"lineNumber":217915,"originalJapaneseLine":"　まずは話し合いからするんだからね。","translatedEnglishLine":"First, we'll try to talk it out."},{"lineNumber":217916,"originalJapaneseLine":"　いきなり戦おうとしちゃ駄目よ？」","translatedEnglishLine":"You mustn't try to fight right away, okay?\""},{"lineNumber":217917,"originalJapaneseLine":"「馬ー鹿、そんなのが通用する相手かよ」","translatedEnglishLine":"\"Idiot, do you think that works on these guys?\""},{"lineNumber":217918,"originalJapaneseLine":"「話してみないと分からないでしょ？","translatedEnglishLine":"\"We won't know unless we try talking, right?"},{"lineNumber":217919,"originalJapaneseLine":"　それに――」","translatedEnglishLine":"Besides—\""},{"lineNumber":217920,"originalJapaneseLine":"「んふふー、そう言いながら、","translatedEnglishLine":"\"Nfufu, even while saying that,"},{"lineNumber":217921,"originalJapaneseLine":"　魔物兵は殺さないように、","translatedEnglishLine":"I know you're being careful not to kill the monster soldiers,"},{"lineNumber":217922,"originalJapaneseLine":"　気をつけてくれてるの知ってるんだから」","translatedEnglishLine":"you're watching out for that.\""},{"lineNumber":217923,"originalJapaneseLine":"「ありがとー、ザンスちゃん」","translatedEnglishLine":"\"Thanks, Zans-chan.\""},{"lineNumber":217924,"originalJapaneseLine":"「殺すとテメーがブーブーうるせーからだろうが。","translatedEnglishLine":"\"It's because you'd make a fuss if I killed them."},{"lineNumber":217925,"originalJapaneseLine":"　調子乗んなクソチビが」","translatedEnglishLine":"Don't get cocky, you damn runt.\""},{"lineNumber":217926,"originalJapaneseLine":"「うう、ザンスちゃん口悪いよ……」","translatedEnglishLine":"\"Ugh, Zans-chan, your words are harsh...\""},{"lineNumber":217927,"originalJapaneseLine":"「ふふふ、照れ隠し照れ隠し」","translatedEnglishLine":"\"Fufufu, just covering my embarrassment.\""},{"lineNumber":217928,"originalJapaneseLine":"「黙ってろ、ナギ！」","translatedEnglishLine":"\"Shut up, Nagi!\""},{"lineNumber":217929,"originalJapaneseLine":"「ととと、みんなーストップでござるー！」","translatedEnglishLine":"\"Toto, everyone—stop!\""},{"lineNumber":217930,"originalJapaneseLine":"「おう、どした、ウズメ」","translatedEnglishLine":"\"Hey, what's up, Uzume?\""},{"lineNumber":217931,"originalJapaneseLine":"「ザンス兄上どのが","translatedEnglishLine":"\"Zans-aniue-dono (Brother Zans)"},{"lineNumber":217932,"originalJapaneseLine":"　大好きな待ち伏せでござる」","translatedEnglishLine":"is at his favorite ambush.\""},{"lineNumber":217933,"originalJapaneseLine":"「って、あん？」","translatedEnglishLine":"\"Huh, what?\""},{"lineNumber":217934,"originalJapaneseLine":"一直線に伸びた通路、","translatedEnglishLine":"A corridor stretched out straight ahead,"},{"lineNumber":217935,"originalJapaneseLine":"そこにはズラリと百名以上の魔物兵が","translatedEnglishLine":"where more than a hundred monster soldiers were lined up,"},{"lineNumber":217936,"originalJapaneseLine":"待ち構えていた。","translatedEnglishLine":"waiting in ambush."},{"lineNumber":217937,"originalJapaneseLine":"「そこの人間共よ！」","translatedEnglishLine":"\"Hey you humans there!\""},{"lineNumber":217938,"originalJapaneseLine":"代表らしき兵が前に出て叫ぶ。","translatedEnglishLine":"A soldier, apparently their representative, stepped forward and shouted."},{"lineNumber":217939,"originalJapaneseLine":"「この都市は魔軍の領地であり、","translatedEnglishLine":"\"This city is territory of the demon army,"},{"lineNumber":217940,"originalJapaneseLine":"　貴様らのやっていることは侵犯行為である！」","translatedEnglishLine":"your actions are an act of intrusion!\""},{"lineNumber":217941,"originalJapaneseLine":"「これは警告だ！","translatedEnglishLine":"\"Consider this a warning!"},{"lineNumber":217942,"originalJapaneseLine":"　今すぐこの地より去れば良し！","translatedEnglishLine":"Leave this place immediately!"},{"lineNumber":217943,"originalJapaneseLine":"　去らねば実力行使を持って応えることとなる！」","translatedEnglishLine":"If you do not, we will respond with force!\""},{"lineNumber":217944,"originalJapaneseLine":"「けっ、えらっそーに！","translatedEnglishLine":"\"Tch, acting all high and mighty!"},{"lineNumber":217945,"originalJapaneseLine":"　先に侵略行為働いたのはテメーらだろーが！」","translatedEnglishLine":"You're the ones who did the invading first!\""},{"lineNumber":217946,"originalJapaneseLine":"「ふふん……","translatedEnglishLine":"\"Hmph..."},{"lineNumber":217947,"originalJapaneseLine":"　だが、よーやく客をもてなそうって","translatedEnglishLine":"But, I’ll praise you for finally trying to entertain your guests."},{"lineNumber":217948,"originalJapaneseLine":"　気になったのは褒めてやる」","translatedEnglishLine":"\"That’s something worthy of praise.\""},{"lineNumber":217949,"originalJapaneseLine":"「そ、それでこれからどうしますだすか？」","translatedEnglishLine":"\"S-So, what shall we do now?\""},{"lineNumber":217950,"originalJapaneseLine":"「どうもこうも……","translatedEnglishLine":"\"There’s no other choice..."},{"lineNumber":217951,"originalJapaneseLine":"　このままじゃ通れないわね……」","translatedEnglishLine":"We can't pass through here as it is...\""},{"lineNumber":217952,"originalJapaneseLine":"「回り道する？」","translatedEnglishLine":"\"Should we take a detour?\""},{"lineNumber":217953,"originalJapaneseLine":"「どこもかしこも、","translatedEnglishLine":"\"Everywhere, I think,"},{"lineNumber":217954,"originalJapaneseLine":"　多分こんな感じになってると思うけどね」","translatedEnglishLine":"it’s probably like this all around.\""},{"lineNumber":217955,"originalJapaneseLine":"「あ、あのー……すみませーん……」","translatedEnglishLine":"\"Um, excuse me...\""},{"lineNumber":217956,"originalJapaneseLine":"「私達はここの魔物将軍である、","translatedEnglishLine":"\"We are here to see Dalson-sama,"},{"lineNumber":217957,"originalJapaneseLine":"　ダルソン様にお会いしたいだけなのですが、","translatedEnglishLine":"the monster general of this place,"},{"lineNumber":217958,"originalJapaneseLine":"　良ければ取り次いで頂けないでしょうかー？」","translatedEnglishLine":"could you please let us meet him?\""},{"lineNumber":217959,"originalJapaneseLine":"「魔軍と人類の戦争はもう終わりました。","translatedEnglishLine":"\"The war between the demon army and humanity is over."},{"lineNumber":217960,"originalJapaneseLine":"　これからは戦わずに平和的な話し合いを――","translatedEnglishLine":"From now on, we seek peaceful negotiations without fighting—"},{"lineNumber":217961,"originalJapaneseLine":"　","translatedEnglishLine":""},{"lineNumber":217962,"originalJapaneseLine":"　　＜カカカカカ！＞","translatedEnglishLine":"　<Kakakakaka!>"},{"lineNumber":217963,"originalJapaneseLine":"「きゃっ！？」","translatedEnglishLine":"\"Kyah!?\""},{"lineNumber":217964,"originalJapaneseLine":"リセットの足下に、","translatedEnglishLine":"At Reset’s feet,"},{"lineNumber":217965,"originalJapaneseLine":"魔物兵達の放った大量の矢が突き刺さった。","translatedEnglishLine":"a barrage of arrows shot by the monster soldiers pierced the ground."},{"lineNumber":217966,"originalJapaneseLine":"「今のは警告である！","translatedEnglishLine":"\"That was a warning!"},{"lineNumber":217967,"originalJapaneseLine":"　これ以上、近づけば我らは本当に容赦しない！」","translatedEnglishLine":"If you come any closer, we will really show no mercy!\""},{"lineNumber":217968,"originalJapaneseLine":"「うう……まあ、そうだよね……」","translatedEnglishLine":"\"Ugh… well, yeah, I guess…\""},{"lineNumber":217969,"originalJapaneseLine":"「さーて、参ったねえ……","translatedEnglishLine":"\"Well then, we're in trouble…"},

{"lineNumber":217970,"originalJapaneseLine":"　どうしようか……","translatedEnglishLine":"What should we do…?"},

{"lineNumber":217971,"originalJapaneseLine":"「＜エール＞ちゃん、どうする？」","translatedEnglishLine":"\"Eiru-chan, what should we do?\""}]}

